import { BrowserRouter as Router } from 'react-router-dom';
import setRoutes from './routes'; 
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <setRoutes />
      </div>
    </Router>
  );
}


export default App;
